import './App.css';

const mensaje = () => {
  return 'Hola Mundo'
}
function App() {

  return (
    <div className="App">
      {mensaje}
      <h1>mensaje</h1>
      <br></br>
      +new Date()
    </div>
  );
}

export default App;
